import styled from "styled-components";

import HorizontalLine from "../../../HorizontalLine";

import Row from "./Row";
import Cell from "./Cell";

const ContainerTable = styled.div`
  width: 100%;
  height: 10px;
`;

<Table
widthCells={[5, 10, 10, 50, 25]}
primaryRowData={primaryRowData}
rowsData={rowsData}
/>

const Table = ({widthCells, primaryRowData, rowsData}) => {
  return (
    <ContainerTable>
      <HorizontalLine></HorizontalLine>
      {[5, 10, 10, 50, 25].map((el) => {
        <Row></Row>;
      })}
    </ContainerTable>
  );
};

export default Table;
